import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button } from 'react-bootstrap';
import Routes from './Routes';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Button variant="primary">Learn React</Button>
      </header>
      <Routes />
    </div>
  );
}

export default App;
